import React from "react";
import { useSelector } from "react-redux";
function Card(props) {
  const search = useSelector((state) => state.search);
  if (search.songs) {
    console.log(search.songs.data.results);
  }

  return (
    <div>
      <h1>{
           search.songs?(search.songs.data.results.map(function(song){
            <h1>{song.artistName}</h1>
           })):(<p>loading</p>)
          }</h1>
    </div>
  );
}

export default Card;
